function Write-Log {
        param([string]$Message, [string]$Level = 'Information')
        if ($useLogging) {
            Write-CustomLog -Message $Message -Level $Level
        } else {
            $colors = @{
                'Information' = 'White'
                'Success' = 'Green'
                'Warning' = 'Yellow'
                'Error' = 'Red'
            }
            Write-Host $Message -ForegroundColor $colors[$Level]
        }
    }

catch {
            # Silently skip files that can't be read
        }

catch {
        # Metrics collection failed, continue without them
    }

catch {
            # Ignore if not in a GitHub repo
        }

catch {
            # Silently continue if log files can't be read
        }

catch {
        # Continue if we can't read config (avoid infinite recursion)
    }

return @{
        Fits = $fits
        Bounds = $bounds
        Container = $Container
        Overflow = @{
            Horizontal = [Math]::Max(0, $bounds.Width - $Container.Width)
            Vertical = [Math]::Max(0, $bounds.Height - $Container.Height)
        }
    }

function Get-FileHash {
    <#
    .SYNOPSIS
        Get hash of file content for change detection
    #>
    [CmdletBinding()]
    param(
        [Parameter(Mandatory)]
        [string]$Path
    )

    if (-not (Test-Path $Path)) {
        return $null
    }

    $hash = Get-FileHash -Path $Path
    return $hash.Hash
}

